import React from "react";
import { takeRandomUnit } from "./units/Units";

const App: React.FC = () => {
  const rederCell = (position: number): any => {
    let unit: any = takeRandomUnit();
    return (
      <div className="cell">
        <button className="icon ">
          <progress value={20} max={unit._HP}>
          </progress>
          <img className="image" src={unit._imgPath} alt="img" />
        </button>
      </div>
    );
  };
  const renderField = (): any => {
    return (
      <div className="battleField">
        <div>{rederCell(1)}</div>
        <div>{rederCell(2)}</div>
        <div>{rederCell(3)}</div>
        <div>{rederCell(4)}</div>
        <div>{rederCell(5)}</div>
        <div>{rederCell(6)}</div>
        <div>{rederCell(7)}</div>
        <div>{rederCell(8)}</div>
      </div>
    );
  };
  return <div className="app">{renderField()}</div>;
};

export default App;
